import { useEffect, useState } from "react";

function App() {
  fetch("https://pokeapi.co/api/v2/pokemon/ditto")
    .then((res) => res.json())
    .then((data) => {
      console.log(data);
    });

  return (
    <div className="App">
      <h1>Pokedex!</h1>
    </div>
  );
}

export default App;
